===Statistics===
* According to the 2010 United States Census, ''Yano'' is the 24787<sup>th</sup> most common surname in the United States, belonging to 1005 individuals. ''Yano'' is most common among Asian/Pacific Islander (66.57%), White (21.19%), and Multi-racial (10.25%) individuals.
